function Project(props) {
	return (
		<div className="project-container">
			<img className="project-image" src={props.img} alt={props.imgalt} />
			<article>
				<h3>{props.name}</h3>
				<p>{props.info}</p>
				<p>{props.info2}</p>
				<a className="cto" href={props.url}>
					Site
				</a>
				<a className="cto" href={props.repo}>
					Repo
				</a>
			</article>
		</div>
	);
}

export default Project;
